import "./card.css"

export default function Card(props) {
  const {name, species, gender, image, onClose} = props;      
   return (
      <div className="card_container">
         <button onClick={onClose}>X</button>
         <h2>{name}</h2>
         <img  src={image} alt={name} />
         <h2>{species}</h2>
         <h2>{gender}</h2>
      </div>
   );
}
